      out.write("\r\n");
      out.write("	str[str.length]=e.getYear();\r\n");
      out.write("	str[str.length]=e.getMonth()+1;\r\n");
      out.write("	str[str.length]=e.getDate();\r\n");
      out.write("	return str.join(\"\");\r\n");
      out.write("}\r\n");
